import React from 'react';
import { View, KeyboardAvoidingView, Image, TextInput, TouchableOpacity, Text } from 'react-native';

export default function Login() {
    return (
        <KeyboardAvoidingView>
            <View>
                <Image
                source={require('../assets/img/logo.png')}
                />
                <TextInput 
                placeholder="Username"
                autoCorrect={false}
                onChangeText={()=> {}}
                />
                <TextInput
                placeholder="Senha"
                autoCorrect={false}
                onChangeText={()=> {}}
                />

                <TouchableOpacity>
                    <Text>Entrar</Text>
                </TouchableOpacity>
                <TouchableOpacity>
                    <Text>Criar conta gratuita</Text>
                </TouchableOpacity>
            </View>
        </KeyboardAvoidingView>
    );
}
